import React, { Component } from 'react';
import axios from 'axios';
import Todo from './Todo'; 

class App extends Component {
  state = {
    books: []
  }
  componentDidMount() {
    fetch('http://localhost:5001/view_books').then((response) => {
      this.setState({
        books:response.data
      })
    });
  }
  render() {
    return (
      <div className="App"> <Todo /></div>
    )
  }
}
export default App;
